@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:ATM a owl:Class .
atm:Account a owl:Class .
atm:Bank a owl:Class .
atm:CashCard a owl:Class .
atm:Customer a owl:Class .

atm:ownsCard a owl:ObjectProperty ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:CashCard .

atm:belongsToBank a owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Bank .

atm:hasAccount a owl:ObjectProperty ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:Account .

atm:cardIssuedBy a owl:ObjectProperty ;
    rdfs:domain atm:CashCard ;
    rdfs:range atm:Bank .

atm:ATM rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty atm:belongsToBank ;
    owl:someValuesFrom atm:Bank
] .

atm:CashCard rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty atm:cardIssuedBy ;
    owl:someValuesFrom atm:Bank
] .

atm:Customer rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty atm:ownsCard ;
    owl:someValuesFrom atm:CashCard
] .

atm:Customer rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty atm:hasAccount ;
    owl:someValuesFrom atm:Account
] .

atm:IncorrectPasswordEntry a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:belongsToATM ;
        owl:someValuesFrom atm:ATM
    ] ,
    [
        a owl:Restriction ;
        owl:onProperty atm:enteredCard ;
        owl:someValuesFrom atm:CashCard
    ] ,
    [
        a owl:Restriction ;
        owl:onProperty atm:entryCount ;
        owl:qualifiedCardinality "3"^^xsd:nonNegativeInteger
    ] .

atm:ATM rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty atm:keepsCard ;
    owl:someValuesFrom atm:IncorrectPasswordEntry
] .
